Are you passionate about sports? Our customer/employer is in the sports entertainment business, we are looking for a Remote iOS Developer. This role can be performed remote. Candidates need to be willing to travel within Europe from time to time.

This position is long-term. Candidates need to live and work in Spain to make occasional internal meetings on-site or team building activities possible.

During the corona crisis, interviews will be conducted online, and travel is not required for the interviews.

Tasks and Responsibilities:
• Develop and maintain iOS codebases;
• Communicate, collaborate and engage with the team;
• Focus on clean, testable and reusable code;
• Maintain high code standards whilst working efficiently;

Profile:
• Bachelor or Master degree;
• +3 years of iOS development experience;
• Experience with working with Swift;
• Experience with working with Apple frameworks, UIKit, Foundation, AVFoundation;
• Experience with applied testing knowledge;
• Experience using version control systems, such as Git;
• Knowledge of SOLID principles and other software best practices;
• Demonstrable unit testing skills;
• Fluent English;

Offered:
• Attractive salary package;
• Possibility to attend conferences and follow online training courses;

Interested:

Please send your resume and motivation to vacature@talent40.com.

We are urgently looking for a (Senior) iOS Developer in the region of Murcia. Candidates need to have a good level of English or willing to improve/learn. This position is remote and long-term.

Tasks and Responsibilities:
• Design and develop software solutions to client requirements;
• Participate in identifying problem areas and defining solutions;
• Able to articulate problems and solutions in non-technical language to stakeholders;
• Understand interactions and dependencies between software components;
• Support the product engineering lead(s) in project set up, execution and key ceremonies including backlog refinement, sprint planning, demos and retrospectives;
• Support learning and development activities for junior product engineering resources;

Profile:
• College / university degree, Bacc. Ing. Comp (or similar);
• +3 years of mobile development experience using iOS frameworks such as Core Data, Cocoa Touch etc;
• +5 years of software development experience;
• Strong understanding of Apple’s design principles & interface guidelines;
• Experience with MVVM, MVC & Viper architecture;
• Experience with offline storage, threading and performance tuning;
• Familiar with RESTFUL APIs, cloud message APIs and notifications;
• Knowledge of RxSwift, Core Animation, Core Location;
• Experience with automated build and test;
• Familiar with GIT, Jenkins and other CI/CD development environments;
• Experience of working in scrum / sprint teams using agile ways of working including knowledge of JIRA / ADO;
• Candidates need to have a good level of English and/or willing to improve/learn;

Technologies: iOS Frameworks (Core Data, Cocoa Touch etc.), Core Animation, Core Location, MVVM, MVC, Viper, Restful API, RxSwift, Swift, UIKit

